  standalone: true,
  templateUrl: './indicator.html',
  styleUrl: './indicator.scss'
})
export class Indicator {
  @Input() status: string = '';

  private readonly statusColorMap: { [key: string]: string } = {
    'green': 'var(--true-color)',
    'yellow': 'var(--warn-color)',
    'red': 'var(--error-color)',
    'gray': 'var(--neutral-color)'
  };

