(days: number): string => {
  const now = new Date();
  const utcNow = Date.UTC(
    now.getUTCFullYear(),
    now.getUTCMonth(),
    now.getUTCDate() + days,
    now.getUTCHours(),
    now.getUTCMinutes(),
    now.getUTCSeconds()
  );
  return new Date(utcNow).toISOString();
}

